import React, { Component } from 'react';

export default class PortfolioContainer extends Component {
    render() {
        return (
            <div>
                <h2>Portfolio</h2>
                {
                    this.props.stocks.map(stockObj=> <StockItem stock={stockObj} key = {stockObj.id} handleClick = {this.props.buyStock}/>)
                }

            </div>
        )
    }
}
